import React from 'react'
import {EachCountry} from "./EachCountry";

export class Countries extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>
            {this.props.data.map(
                    (data)=> <EachCountry key={data.country} objectCount={data.objectCount} objectIDs={data.objectIDs}
                    iso={data.iso} lat={data.latLon[0]} lon={data.latLon[1]}/>
                    )}
            </div>
        )
    }

}
